import React ,{useContext}from 'react'
import {Link} from "react-router-dom"
import Search from './Search'
import {proContext} from "./Context"
import {HomeOutlined,ShoppingCartOutlined} from '@ant-design/icons'

export default function Nav() {
  const{TotalNum}=useContext(proContext)
  return (
    <div>
        <Link to="/"><HomeOutlined style={{ fontSize: '30px', color: 'orange' }}/>店铺首页</Link>
        <Link to="/cart"><ShoppingCartOutlined style={{ fontSize: '30px', color: 'orange' }}/>({TotalNum()})购物车</Link>

        {/* <Link to="/checked"><CreditCard size={30} />结账</Link> */}
        <Search/>
    </div>
  )
}
